import React from 'react'
import {Formik, Form, Field, ErrorMessage} from 'formik';
import * as Yup from 'yup';
import axios from "axios";
import { useEffect, useState } from 'react';

function CreateProfile() {

    const [listOfProfiles, setListOfProfiles] = useState([]);

    const initialValues = {

    };

    const onSubmit = (data) => {

    };

    const validationSchema = Yup.object().shape({

    });

  return (
    <div>
        <Formik initialValues={initialValues} onSubmit={onSubmit} validationSchema={validationSchema}>
            <Form>
                <label>Your Name: </label>
                <ErrorMessage name="name" component="span"/>
                <Field autoComplete="off" id="inputCreateProfile" name="name" placeholder="Example: John" />
                
                <label>Age: </label>
                <ErrorMessage name="age" component="span"/>
                <Field autoComplete="off" id="inputCreateProfile" name="age" placeholder="Example: 15" />
                
                <label>Gender: </label>
                <ErrorMessage name="gender" component="span"/>
                <Field autoComplete="off" id="inputCreateProfile" name="gender" placeholder="Example: male/female" />
                
                <label>Height(cm): </label>
                <ErrorMessage name="height" component="span"/>
                <Field autoComplete="off" id="inputCreateProfile" name="height" placeholder="Example: 170" />
                
                <label>Activity Status: </label>
                <ErrorMessage name="activeStatus" component="span"/>
                <Field autoComplete="off" id="inputCreateProfile" name="activeStatus" placeholder="Example: daily" />
                
                <label>Metabolism Type: </label>
                <ErrorMessage name="metabolismType" component="span"/>
                <Field autoComplete="off" id="inputCreateProfile" name="metabolismType" placeholder="Example: mezomorph" />
                
                <label>Special Requests(Choose any number of requests:(vegan, vegetarian, lactose-free, peanuts-free, glucose-free)): </label>
                <ErrorMessage name="metabolismType" component="span"/>
                <Field autoComplete="off" id="inputCreateProfile" name="metabolismType" placeholder="Example: mezomorph" />
                
                
                <button type="submit">Create Profile</button>
            </Form>
        </Formik>
    </div>
  )
}

export default CreateProfile
